import React from 'react'
import './que-incluye.css'

class QueIncluye extends React.Component{
    render(){
        return(
            <div className="cards-que-incluye-list">
                {this.props.datos.Princess.map(
                    (incluye) => {
                        return(
                             <div className="card-que-incluye 1">
                    <div className="card-que-incluye_image"> 
                    <img src="https://st2.depositphotos.com/2251265/6318/i/950/depositphotos_63188207-stock-photo-businessman-at-airport-near-the.jpg" /> </div>
                    <div className="card-que-incluye_title title-que-incluye-white">
                        <p>{incluye}</p>
                    </div>    
                    </div>
                        )
                    }
                )}
  
               
            </div>


        )
    }
}

export default QueIncluye
